import React from 'react';

const MandalArtTable = ({aa, ab, ac, ba, bb, bc, ca, cb, cc}) => {
    const list = [['1', '2', '3'], ['4', '5', '6'], ['7', '8', '9']];

    return (
        <table>
            {list.map((goal, index) => (
                <tr key={index}>
                    {goal.map((goal, index) => (
                        <td><input value={goal}/></td>
                    ))}
                </tr>
            ))}
        </table>
    );
};

export default MandalArtTable;
